import React from 'react';

import './App.css';
import moment from 'moment';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
          Edit  and save to reload.

          <code>src/App.js</code>
          <p>{moment(post.date).format()}</p>
        </p>


      </header>
    </div>
  );
}

export default App;
